import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from './pages/HomePage';
import AboutUs from './pages/AboutUs';
import Contact from './pages/Contact';
import Results from './pages/Results';
import LoginPage from "./pages/LoginPage";
import Dashboard from "./components/Dashboard";
import "./App.css";

const App = () => {
    return (
        <Router>
            <nav>
                <ul>
                    <li><Link to="/home">Home</Link></li>
                    <li><Link to="/aboutus">About Us</Link></li>
                    <li><Link to="/contact">Contact</Link></li>
                    <li><Link to="/results">Results</Link></li>
                </ul>
            </nav>
            <Routes>
                <Route path="/" element={<LoginPage />} />  {/* Login Page for '/' */}
                <Route path="/dashboard" element={<Dashboard />} />  {/* Dashboard for '/dashboard' */}
                <Route path="/home" element={<HomePage />} />  {/* Home Page for '/home' */}
                <Route path="/aboutus" element={<AboutUs />} />  {/* About Us Page for '/aboutus' */}
                <Route path="/contact" element={<Contact />} />  {/* Contact Page for '/contact' */}
                <Route path="/results" element={<Results />} />  {/* Results Page for '/results' */}
            </Routes>
        </Router>
    );
};

export default App;
